Last modified: Tue Sep 25 2018 22:34:59 GMT+0200 (GMT+02:00)

TodoList : (Ré-)écrire les API du projet
Le but de notre application est de créer des API Rest qui vont exposer la gestion de nos todos défini en base de données
Introduction
Dans ce TP nous allons voir la création d’API pour le projet « TodoList ». Nous allons donc créer un nouveau projet avec Laravel pour créer des API qui permettront de :

Lister les éléments dans la TodoList.
Créer un nouvel élément dans la TodoList.
Marquer un élément comme terminé.
Supprimer un élément.

Création du projet
Pour créer des API, Laravel est un peu « lourd » (dans notre cas bien évidemment, dans certains cas te choix est complètement justifié). Nous allons donc utiliser son petit frère Lumen. Lumen est un micro-framework reprenant les concepts de Laravel (et les même briques), mais en beaucoup plus petit et donc plus adapté à des micro-projets comme celui-ci.
Installer Lumen
L’installation de Lumen est similaire à celle de Laravel
composer global require "laravel/lumen-installer"

Créer le nouveau Projet
Maintenant que vous avez installé Lumen nous allons pouvoir utiliser la ligne de commande pour créer un nouveau projet :
lumen new api-todo

✋ Attention, le projet va être créé dans le dossier api-todo dans le dossier courant.
Initialisation
Contrairement à un projet Laravel, les dépendances composer ne sont pas installées par défaut. Il faut donc les installer via la ligne de commande en faisant :
composer install

Le projet n’étant pas initialisé nous allons devoir jouer quelques commandes pour terminer l’installation :
mv .env.example .env

PS: Sous Windows c'est :
move .env.example .env

Contrairement à Laravel, Lumen ne contient pas l’outils permettant d’initialiser la « secret key » nécéssaire à la sécurisation de votre application. Je pous propose par exemple de passer via la commande suivante :
PS: Sous Windows la commande ne fonctionnera pas.
openssl rand -base64 24

(Vous pouvez également faire du monkey typing… et saisir une chaine de caractère aléatoire avec votre clavier…)
éditer le fichier .env pour y renseigner la valeur obtenue :

APP_KEY (exemple APP_KEY="I82xtis8Tsur2")

Tester votre application
Pour tester votre application avec Lumen sur votre poste, c’est un peu plus « complexe » qu’avec Laravel. Vous devez saisir la commande suivante :
php -S localhost:8000 -t ./public

Une fois lancé vous avez un serveur Web qui écoute sur le port 8000
🤔 Pourquoi Lumen n’intègre pas la commande php artisan serve ? La raison est plutôt logique, Lumen étant un micro framework il n’embarque pas toutes les options de base de Laravel. Options qui peuvent d’ailleurs simplement être remplacée.
Gestion de la base de données
Pour la démonstration nous allons utiliser SQLite au lieux de MySQL. Pour ça rien de plus simple, Lumen utilise PDO il suffit donc de changer la configuration par défaut dans le fichier .env. Modifier le fichier pour qu’il ressemble à celui-ci
APP_ENV=local
APP_DEBUG=true
APP_KEY="CHANGEME"
APP_TIMEZONE=UTC

DB_CONNECTION=sqlite
# DB_HOST=127.0.0.1
# DB_PORT=3306
# DB_DATABASE=homestead
# DB_USERNAME=homestead
# DB_PASSWORD=secret

CACHE_DRIVER=file
QUEUE_DRIVER=sync

Par défaut la configuration de base de SQLite dans Lumen est l’utilisation d’une base de données nommée database.sqlite il faut donc créer un fichier vide qui recevra les données :
touch database/database.sqlite

Sous Windows la commande touch n'existe pas. Il faut créer un fichier vide (sans retour à la ligne) dans votre IDE / éditeur de texte.
C’est parti ! Tout est prêt, nous pouvons commencer à écrire du code.
Le script de création / migration
Contrairement à la première version de notre application, nous allons stocker les données dans une base de données. Qui dit base de données dit « ORM » et donc mapping objet. Pour rappel un ORM :

Un mapping objet-relationnel (en anglais object-relational mapping ou ORM) est une technique de programmation informatique qui crée l'illusion d'une base de données orientée objet à partir d'une base de données relationnelle en définissant des correspondances entre cette base de données et les objets du langage utilisé.

Pour rappel, le but de notre application est de créer des API Rest qui vont exposer la gestion de nos todos défini en base de données. La première étape est de créer via la ligne de commande le « script » qui initialisera la structure de votre base de données.
L’option --create=todos permet d’indiquer le nom de la table à créer
php artisan make:migration create_todos_table --create=todos

✋ Le contenu du fichier est fictif, il est la pour illustrer comment travailler. Nous allons le modifier pour mettre les informations relative à notre table.
La commande a créé un nouveau fichier (dans mon cas) : database/migration/2017_11_02_205700_create_todos_table.php
Dans le fichier créé nous allons définir notre schéma (à savoir la définition de la table) pour ajouter les 2 colonnes qui nous serons utiles texte et termine. Le fichier après modification doit ressembler à :
increments('id');
            $table->string('texte');
            $table->boolean('termine');
            $table->timestamps();
        });
    }

    /**
     * Reverse the migrations.
     *
     * @return void
     */
    public function down()
    {
        Schema::dropIfExists('todos');
    }
}

Maintenant que le script est terminé, nous pouvons lancer la commande de migration :
php artisan migrate

Une fois cette commande lancée, Lumen va créer la structure de base de votre base de données.
Le modèle
Maintenant que nous avons fait le script de création / migration, nous allons définir notre modèle. Pour ça créez un fichier Todos.php dans le dossier app/ avec le contenu suivant :

le $fillable définie les propriétés qui doivent êtres automatiquement remplis par Eloquent (l’ORM) lors de l’execution du code.
Le controller
Maintenant que nous avons notre base de données, nous allons créer le controller. Pour rappel le controller va faire « le lien » entre la base de données et les appels HTTP. C’est ici que nous allons mettre la logique métier de nos API.
Pour commencer nous allons créer « la structure de base » de notre controller. Pour ça créez le fichier TodosController.php dans le chemin suivant app/Http/Controllers/ et mettez y le contenu suivant :

Bien ! Notre code est maintenant prêt. Nous allons créer les méthodes permettant la manipulation de notre base de données tout en répondant à nos API bien évidement (liste, creation, terminer, suppression).
Nous allons maintenant écrire une méthode pour chaque actions. Avec les différentes conditions nécéssaires au bon fonctionnement de votre application.
Liste
La méthode liste est certainement la plus simple, nous allons simplement faire appel à la méthode all() de Eloquent (ORM pour l’accès à la base de données). Pour ça créez une nouvelle méthode dans la Class TodoController avec le code suivant :
public function list(){
    $todos  = Todos::all();
    return response()->json($todos);
}

Rien de bien compliqué, comme vous pouvez le voir le response()->json(…) permet de créer une réponse au format JSON pour votre API (que l’on utilisera plus tard au moment de la mise en place des routes).
Création
Pour la partie création, nous allons faire un mapping automatique entre la requette HTTP et le modèle Todos
public function saveTodo(Request $request){
    $todo = Todos::create($request->all());
    return response()->json($todo);
}

Que va t’il se passer lors de l’appel ? L’objet $request contient tous les paramètres de l’appel HTTP, la méthode all() permet de les récupérer. L’objet Todos possède une méthode permettant de créer un nouvel enregistrement en base de données. Les valeurs passées en paramètre de create() permette de renseigner automatiquement les champs en base de données.
Création, version alternative
La première approche est la plus rapide mais elle sous entend que tous les paramètres soient bien initialisés dans « l’input » HTTP. Dans cette version la méthode est plus complète et gère la création de l’objet Todo manuellement en récupérant les différents éléments dans la requette HTTP
public function saveTodo(Request $request){
    $texte = $request->input('texte');

    if($texte){
      $todo = new Todos();
      $todo->texte = $texte;
      $todo->termine = 0;
      $todo->save();
      return response()->json("success");
    }else{
      return response()->json("error");
    }
  }

Terminer
Pour l’action terminer nous allons devoir updater un enregistrement en base de données, pour ça nous allons le récupérer puis mettre le boolean termine à 1.
public function markAsDone($id){
        $todo  = Todos::find($id);
        if($todo){
            $todo->termine = 1;
            $todo->save();
            return response()->json("success");
        }else{
            return response()->json("error");
        }
    }

Suppression
Pour la partie suppression, nous allons devoir dans un premier temps récupérer la todo par son ID. Seul les Todos marqués comme terminés peuvent être supprimé, il faudra donc controller l’état avant de faire le delete()
public function deleteTodo($id){
        $todo  = Todos::find($id);
        if($todo && $todo->termine){
            $todo->delete();
            return response()->json('success');
        }else{
            return response()->json('error');
        }
}

Déclarer les routes
Maintenant que le mapping avec la base de données est créé, et que notre controller est disponible nous allons pouvoir déclarer les différentes « routes » (c’est à dire les chemins d’accès à votre API). Dans notre applicaton nous avons 4 routes :

Liste (/liste)
Création (/creation)
Terminer (/terminer)
Suppression (/suppression)

Nous allons « mapper » / « connecter » les routes avec les différentes actions de notre controller. Avec un framework c’est très simple il suffit d’ajouter dans le fichier routes/web.php le code suivant :
$router->get('api/todo','TodosController@list');
$router->post('api/todo','TodosController@saveTodo');
$router->post('api/todo/done/{id}','TodosController@markAsDone');
$router->delete('api/todo/delete/{id}','TodosController@deleteTodo');

Activer le support d’Eloquent
Avant de pouvoir tester votre application vous devez éditer le fichier bootstrap/app.php pour décommenter la ligne :
$app->withEloquent();

Eloquent ? Un peu de documentation sur le Framework d'accès à la base de données (oui… On ne fera pas de requête !)
Tester
Pour tester votre application il suffit de lancer la commande suivante :
php -S localhost:8000 -t ./public

Pour tester vous pouvez utiliser PostMan.
Changer les API dans votre application VueJS
Maintenant que vos nouvelles API sont terminées nous allons pouvoir les utiliser dans VueJS. Pour ça éditer le code Javascript de votre projet VueJS pour pointer vers votre serveur Lumen.

tp/vuejs/tp1-vuejs-laravel-api.html.body:
Last modified: Fri Nov 30 2018 15:09:31 GMT+0100 (GMT+01:00)

Ajouter VueJS dans un site existant
Dans le cadre du TP, vous allez devoir « moderniser » une application simple. L’application à migrer a été réalisée dans le cadre de la démonstration.
L’application existante est une « TodoList » codée avec le Framework Laravel.
Les API
Dans ce TP nous allons transformer « entièrement » votre ancien site codé en Laravel par « un équivalent » qui va fonctionner avec des API.
🤓 Nous n'allons donc plus utiliser la puissance de Blade, mais celle de VueJS 🚀.
Création des API
La « nouvelle version » de notre page, va utiliser des API (et de l'ajax), ça va fondamentalement changer le fonctionnement de votre application. Il faut donc dans un premier temps créer les API qui seront nécessaires au bon fonctionnement (asynchrone) de votre page Web.

Lister les éléments dans la TodoList.
Ajouter un nouvel élément dans la TodoList.
Marquer un élément comme terminé.
Supprimer un élément.

✋ En tant que développeur vous devez être malin (et fénéant…). Pour écrire les autres API ne tenter pas de réinventer la roue, nous allons utiliser le même code que le contrôleur actuel !
Les seules différences seront :

view([…], […]Todo::all()[…]) remplacé par return response()->json(Todo::all());
Et pour une simple réponse de réussite (exemple remove ou done) return response()->json(array("status" => 1))

Création du contrôleur pour les API
Nous allons donc créer un nouveau contrôleur qui va gérer la partie API de notre application (les appels « client »). Nous allons simplement l'appeler « api ».
Pour le créer il faut utiliser la commande make:controller
 Voir la solution php artisan make:controller api



Un nouveau contrôleur vide vient d'être créé, il faut maintenant déclarer l'ensemble de nos méthodes.
Définition des méthodes nécessaires
Avant de commencer la partie code, voilà la liste des Routes -> Méthode nécessaires au bon fonctionnement de notre API :



Route
Méthode
Paramètre
Type




/api/
list()

GET


/api/add
add(Request $request)
Request
POST


/api/done/{id}
done($id)
id
PATCH


/api/delete/{id}
remove($id)
id
DELETE



🔥 Pour la suite référez-vous à ce tableau pour les noms de méthode ainsi que les paramètres 🔥
La liste
Dans le fichier app/Http/Controllers/api.php ajouter une méthode nommée list. Celle-ci doit contenir le code suivant :
    return response()->json(Todos::all());

⚠️ Bien évidement je vous laisse écrire le reste du code. Vous pouvez vous inspirer du code du premier TP.
L'ajout
Pour l'ajout, le code va être identique à celui de premier TP, la seule différence c'est que celui-ci doit retourner 1 ou 0 en fonction de la réussite ou non :
  return response()->json(array("status" => "1"));

⚠️ Je vous laisse écrire le reste du code !
Marquer comme terminé
Comme pour l'ajout, le code va être identique au TP précédent à l'exception du retour :
  return response()->json(array("status" => "1"));
  // Ou en en cas échec
  return response()->json(array("status" => "0"));

Suppression
Comme pour l'ajout, le code va être identique au TP précédent à l'exception du retour :
  return response()->json(array("status" => "1"));

  // Ou en en cas échec d'ajout il faudra retourner
  return response()->json(array("status" => "0"));

⚠️ Attention à faire correctement le test !
Perdu
Normalement vous avez l'ensemble des informations pour y arriver seul, si vous bloquez voila :
 Voir la définition des méthodes 


✋ Je vous laisse écrire le code des méthodes seul, rappel il est presque identique à celui du premier TP.
Les routes
Le code étant « finalisé ». Il faut maintenant indiquer à Laravel les routes (chemin / url) d'accès aux différentes méthodes.
Dans le fichier routes/api.php ajouter le contenu suivant :
Route::get('/', "api@list")->name("api.list");
Route::post('/add', "api@add")->name('api.add');
Route::patch('/done/{id}', "api@done")->name('api.done');
Route::delete('/delete/{id}', "api@delete")->name('api.delete');

✋ Comme vous pouvez le voir le /api/… n'est pas spécifié… Pourquoi ?
Simplement avec Laravel toutes les routes dans le fichier routes/api.php sont automatiquement préfixées par /api/. 🤯
Vous API sont maintenant accessibles.
Validation des API
Valider que vos API fonctionnent correctement grâce à l'outil Postman.
(Pssst! La création de compte n'est pas obligatoire) 
🤓 Commencez par la plus simple, par exemple /api/ qui doit normalement lister votre actuelle TodoList.
✋ Tester l'ensemble de vos API avant de continuer.
Utiliser VueJS sans NPM
npm n'est pas la seule solution pour installer VueJS, si votre projet n'utilise pas npm vous pouvez l'utiliser simplement en l'ajoutant dans le header de votre site via une balise script :
Via un CDN :


ou en téléchargant la librairie :
Disponible ici


Questions

Qu'est-ce qu'un CDN ?
À votre avis pourquoi n'avons nous pas utilisé npm et la gestion des dépendances de Laravel ?
Quels sont les dangers du CDN ?

Création d'un nouveau template
Pour la démonstration nous allons créer un nouveau template, il sera @extends de template.blade.php que vous avez précédement créé.
Créér un nouveau fichier resources/views/homevue.blade.php et y mettre le contenu suivant :
@extends("template") @section("title", "Todo List - Version VueJS")
@section("content")














@endsection


Le code précédent contient quelques éléments de VueJS, lequels ?

Accéder à la page
Maintenant que notre template est créé, nous allons pouvoir l'utiliser.
Pour l'utiliser il faut créer 2 choses :

Une méthode dans le contrôleur TodosController.php.
Une route (exemple /vue) dans le fichier routes/web.php.

 Un doute sur le code de la méthode ? Le code de la méthode est :
public function homevue(){
  return view("homevue");
}



🔥 Maintenant que votre code est prêt, tester votre application :

Démarrer votre serveur de test (php artisan serve).
Accéder à la page http://127.0.0.1:8000/vue
Normalement le formulaire d'ajout s'affiche… Rien dans la liste ? Pas de panique le code n'est pas encore présent.

Liste des todos
Même si pour l'instant nous n'avons pas encore fait le code pour appeler les API, ajouter le code HTML suivant après  présent dans le fichier homevue.blade.php:


    @{{ todo.texte }}






    C'est vide !




Quels sont les éléments spécifiques à VueJS ?

🔥 Tester à nouveau, votre liste doit s'afficher… Mais pas de la façon attendu… C'est normal, nous devons maintenant écrire le code VueJS correspondant à votre application (à savoir Liste, Ajout, Marquer comme terminé, et Supprimer).
@ ? Hey !

@ À quoi correspond le @ ? (Pssst, c'est en lien avec Laravel)
Tenter de le retirer pour voir ce qui se passe ?
Pourquoi ça ne fonctionne plus?

Asynchrone
L’ensemble de l’application va devenir « asynchrone », vous allez vite vous rendre compte que la migration va nécessiter quelques appels en Ajax. Pour faire nos appels nous utiliserons l’API « Fetch » des navigateurs, celle-ci est intégrée dans l’ensemble des navigateurs récents, le bon réflexe est quand même d’aller voir le support de Fetch sur (Can i use).
Découverte de Fetch
L'API Fetch fournit une interface JavaScript pour l'accès et la manipulation des parties de la pipeline HTTP, comme les requêtes et les réponses. Cela fournit aussi une méthode globale fetch() qui procure un moyen facile et logique de récupérer des ressources à travers le réseau de manière asynchrone.
Ce genre de fonctionnalité était auparavant réalisé avec XMLHttpRequest. Fetch fournit une meilleure alternative qui peut être utilisée facilement par d’autres technologies comme Service Workers. Fetch fournit aussi un endroit unique et logique pour la définition d'autres concepts liés à HTTP comme CORS et les extensions d'HTTP.
(Source: MDM)
Le support de l'API Fetch peut être détecté en vérifiant l'existence de Headers, Request, Response ou fetch() sur la portée de Window ou de Worker.
Par exemple, vous pouvez faire cela dans votre script:
if (self.fetch) {
  // Le support de Fetch est présent
} else {
  // Gérer le cas du non support de fetch.
  // Pour réduire le nombre de cas possible vous pouvez ajouter : https://github.github.io/fetch/ à votre projet (Yeah fini l'ajax compliqué 😎)
}

Tester Fetch
Avant d'intégrer Fetch dans notre code client (le site web VueJS), nous allons le TESTER dans notre navigateur, voici un exemple de code :
fetch("api/", { method: "GET", credentials: "same-origin" })
  .then(function(response) {
    // On décode le JSON, et on continue
    return response.json();
  })
  .then(function(response) {
    // Votre retour est ICI
    console.log(response);
  })
  .catch(function(error) {
    console.log("Récupération impossible: " + error.message);
  });

⚠️ Que veut dire credentials: 'same-origin'?
Par défaut, Fetch n’utilise pas les Cookies, vous pouvez forcer l’utilisation des cookies en indiquant credentials: 'same-origin'. Si vous ne le faites pas votre $_SESSION ne sera pas sauvegardée ⚠️
Comment tester
Pour valider le bon fonctionnement nous allons utiliser la « Console développeur » de votre navigateur.
Fetch est une librairie très complète, pour aller plus loin dans l’utilisation de Fetch, je vous recommande la lecture de la documentation complète (gestion des headers, paramètres, mode, etc).
Tester de récupérer vos « todos » depuis votre console.
La structure du code javascript
Maintenant que nos API sont terminées et que notre appel via Fetch fonctionne nous allons écrire le code Javascript (VueJS) qui va gérer notre application.
Nous allons utiliser massivement la gestion d'évènement de VueJS.
Pour rappel n’hésitez pas à consulter le cycle de vie des composants).
La liste
La liste des tâches va être la première chose que nous allons charger. Cette « liste » sera chargée lors de l'événement beforeMount.
Les actions
Les actions (done, remove, add) seront appelées lors de la vie de notre application, elles vont être déclarées dans la partie methods de l'objet VueJS et seront appelées via des attributs spéciaux préfixé par v-on:… de votre code HTML.
Complexe ? Pas tant que ça… Vous allez voir que c'est beaucoup plus simple que du code Javascript classique.
Structure de base
Créer un nouveau fichier nommé main.js. Ce fichier doit être créé dans public/js. Une fois créé nous allons y ajouter le minimum pour que votre application fonctionne :
var app = new Vue({
  el: ".container",
  created: function() {
    // Code appelé à la création de votre application
    console.log("Démarrage TODO-APP");
  },
  data: function() {
    return {
      todos: [],
      text: ""
    };
  },
  beforeMount: function() {
    // Code appelé juste avant l'affichage de votre application
    this.list();
  },
  methods: {
    list: function() {
      // Récupération des Todos
      console.log("Récupération Todo depuis le serveur");
    },
    add: function() {},
    done: function(todo) {},
    remove: function(todo) {}
  }
});

Voilà la base de notre objet VueJS.
