        .then(function(response) {
          app.todos = response;
        })
        .catch(function(error) {
          console.log("Récupération impossible: " + error.message);
        });
    },
    add: function() {
      let formData = new FormData();
      formData.append("texte", app.text);

      fetch("api/add", { method: "POST", body: formData }).then(function() {
