        app.list(); // On rafraichit la liste.
      });
    },
    done: function(todo) {
      fetch(`api/done/${todo.id}`, { method: "PATCH" }).then(function() {
        app.list();
      });
    },
    remove: function(todo) {
      fetch(`api/delete/${todo.id}`, { method: "DELETE" }).then(function() {
        app.list();
      });
    }
  }
});



