  el: '.container',
  created: function () {
    console.log("Démarrage TODO-APP");
  },
  beforeMount: function() {
    app.recupererListe();
  }
})

Ajout d’une tâche
Maintenant que la liste est affichée, vous allez pouvoir gérer le cas de l’ajout d’une nouvelle tâche. L’ajout va également être faite via un appel Ajax.

Créer une méthode Javascript, réalisant l’appel de l’API.
⚠️ Attention: L’utilisateur devant être prévenu de l’aspect obligatoire du contenu, vous devez rendre la saisie obligatoire (contrôle de saisie, et/ou via librairie Sweetalert) ⚠️


var app = new Vue({
  […]
  methods: {
    ajout: function () {
      var contenu = document.getElementById("texte").value;
      if(contenu == ""){
        swal("Oops","Vous devez spécifier du texte…" , "error" );
      }else{
        // Appel de l’API avec Fetch (Ajax)
      }
    }
  }
  […]


Créer l’appel à l’API

var form = new FormData();
form.append('texte', contenu);
fetch("api/creation.php", {
  method: "POST",
  body: form,
  credentials: 'same-origin'
})
.then(function(response){
  return response.json();
})
.then(function(response) {
  if(response.success){
    app.recupererListe();
  }else{
    // Sweetalert pour l’utilisateur.
  }
})
.catch(function(error) {
  console.log('Récupération impossible: ' + error.message);
});


Rafraichir la liste des tâches, pour ça vous allez créer une 2nd méthode qui réalise l’appel Ajax de récupération de la liste. Une fois cette méthode faite, appeler la dans la partie // traiter le retour.
Optimiser votre code en remplaçant le code dans le beforeMount par un appel à la méthode que vous avez créé.

Votre objet VueJS, doit ressembler à quelques chose comme ça :
var app = new Vue({
  el: '.container',
  created: function () {
    console.log("Démarrage TODO-APP");
  },
  data: {
      taches: []
  },
  beforeMount: function() {
    this.recupererListe();
  },
  methods:{
    ajout: function () {},
    recupererListe: function (){}
  }
})


Appel de votre code dans le template. Maintenant que votre code est prêt, vous allez pouvoir l’appeler depuis votre template. Pour faire ça, vous allez utiliser la gestion des événements de VueJS Exemple :




Tester votre code.
Tester l’ajout de tâche.
Tenter d’injecter du code. Que se passe-t-il ?

Marquer une tâche comme terminée
Pour marquer une tâche comme terminée, vous allez devoir appeler l’api « terminer.php ». Cette API doit être appelée lors du clique sur l’icône qui à comme class « oi oi-check ».

Utiliser le v-on:click
Remplacer :



Par



Déclarer la méthode « terminer » dans votre objet VueJS. Faite l’appel à votre API.
L’objet VueJS doit maintenant ressemble à quelques choses comme ça :

var app = new Vue({
  el: '.container',
  created: function () {
    console.log("Démarrage TODO-APP");
  },
  data: {
      taches: []
  },
  beforeMount: function() {
    this.recupererListe();
  },
  methods:{
    ajout: function () {},
    recupererListe: function (){},
    terminer: function(id){}
  }
})


Ajouter le v-if nécéssaire à la règle suivante « uniquement les tâches non terminées peuvent être marquées comme terminées »
Tester le fonctionnement.
Valider que seulement les tâches marquées comme « non terminées » peuvent être terminées.

Suppression d’une tâche
La suppression d’une tâche est très similaire à l’action « terminer.php ». Je vous laisse appliquer la méthodologie précédente.
Ne pas oublier la règle de gestion : « Une tâche non marquée comme terminée ne peut être supprimée. »
L’objet doit maintenant ressembler à :
var app = new Vue({
  el: '.container',
  created: function () {
    console.log("Démarrage TODO-APP");
  },
  data: {
      taches: []
  },
  beforeMount: function() {
    this.recupererListe();
  },
  methods:{
    ajout: function () {},
    recupererListe: function (){},
    terminer: function(id){},
    supprimer: function(id){}
  }
})

Optimisation
Comme vous l’avez certainement constaté les deux dernières actions sont très similaire. Faites fusionner les deux actions en ajoutant par exemple un paramètre « action ». Ce paramètre vous permettra de s’avoir dans quel cas vous vous trouvez, je vous laisse écrire le code.
Allez plus loin
Quelques pistes pour allez plus loin dans le code :
Ajouter des confirmations
 Ajout des confirmations avant les actions « marquer comme terminé » et l’action suppression.
Ajouter des règles de réécriture
Ajouter des règles de réécriture via un fichier .htaccess
Le fichier .htaccess exemple :
RewriteEngine On
RewriteRule    ^api/ajouter$    api/ajouter.php    [L,QSA]

Une fois les règles de réécriture faite, modifier les différents chemin (appel d’API) dans votre fichier Javascript.
Partager les TODOS au monde !
Depuis quelques jours Chrome propose une nouvelle API nommée « Web Share Api », Cette API  permet de déclencher « le Partage » d’une informations en utilisant les possibilités native du Téléphone. Comme cette API n’est disponible que sur un téléphone et uniquement en HTTPS vous devez tester si celle-ci est présente avec
if(navigator.share){}

Voir le support de Share
Mais comme nous sommes avec VueJS nous allons gérer ça avec le MVVM (Modèle Vue, Vue-Modèle), ça va nous permettre d’injecter une variable à la création de l’objet app pour connaitre si le partage est disponible. Exemple :
var app = new Vue({
  el: '.container',
  created: function () {
    console.log("Démarrage TODO-APP");
  },
  data: {
      taches: [],
      isShare: navigator.share?true:false
  },
  […]

Une fois fait, vous avez une variable isShare qui sera True Ou False en fonction du support du navigateur. Maintenant que le booléen est disponible vous pouvez ajouter un élément cliquable pour déclencher l’action (prendre exemple sur la suppression ou le marquer comme terminé). Exemple de code pour déclencher le partage :
[…]
methods:{
    share: function(texte){
      navigator.share({
        title: 'VueJS-Todo',
        text: texte,
        url: ""})
        .then(function(){})
        .catch(function(){})
    },
[…]

C’est à vous !

tp/vuejs/firebase-vuejs.html.body:
Last modified: Fri Dec 07 2018 14:16:17 GMT+0100 (GMT+01:00)

Firebase + Vuejs
Dans ce TP nous allons découvrir Firebase RealtimeDB (base de données temps réel). Nous allons coupler cette base de données temps réel à la puissance de VueJS pour obtenir en un rien de temps une WebApplication surpuissante.
Introduction
Dans ce TP nous allons mettre en place une carte du monde qui affiche en temps réel l'emplacement des utilisateurs présent sur votre site.

La mise en place
Nous allons utiliser VueCLI pour initialiser le projet, première étape l'installation.
Installer NodeJS + VueCLI
Avant de commencer nous allons avoir besoin de plusieurs outils :

NodeJS
VueCli

NodeJS
La première étape va être l’installation de NodeJS, la démarche est différente en fonction de votre environnement, mais pour résumer sous Windows c’est ici prendre la version CURRENT, sous OSX le plus simple c’est via Brew brew install nodejs, et sous Linux c’est via le gestionnaire de paquet apt install nodejs
Une fois installé, vous êtes prêt, votre PC est prêt à accueillir l’outil Vue-Cli.
Vue-Cli
Vue-Cli est un outil qui simplifie la création d’un nouveau projet Vue-JS à partir de template fourni par la communauté.
Dans un terminal lancer la commande suivante dans le Node.js Command Prompt :
npm install -g @vue/cli

Maintenant que vue-cli est installé, vous avez à votre disposition sur votre ordinateur une nouvelle commande, la commande vue.
Pour créer un nouveau projet, c’est simple il suffit de lancer la commande suivante dans le Node.js Command Prompt.
Initialiser le projet
La création d'un nouveau projet est très simple. Il suffit de rentrer la commande suivante :
vue create firebase-vuejs

Choisir l'option « Default ».
⚠️ Le projet est créé dans le dossier courant. Veillez à saisir la commande dans un dossier vide.
🤓 git est déjà initialisé, vous pouvez en profiter pour pusher votre code sur Github / Gitlab.
Questions

Pourquoi git est déjà analysé ?
Allez jeter un coup d'œil au fichier .gitignore

Tester
Le projet initialisé par Vue-Cli est imédiatement fonctionnel. Testez-le en saisissant :
npm run serve


Les dépendances
Maintenant que notre projet est « initialisé », nous allons avoir besoin de quelques dépendances NPM pour faire fonctionner notre projet. Notre projet va utiliser les technologies suivantes :

firebase
leaflet

Firebase comme vous le savez va nous servir de système de base de données. Leaflet quant à lui est une librairie qui va nous permettre d'afficher très rapidement une carte sur notre site internet.
Ajouter les dépendances
Les deux outils / librairies que nous allons utiliser sont disponibles via NPM, nous allons donc les installer / ajouter au projet via les commandes suivantes :
npm install firebase vue2-leaflet --save

Configuration de la dépendance carte
Certains plugins nécessitent de la configuration supplémentaire, ça sera le cas pour Vue2-Leaflet (et Firebase). Comme vous, je ne connais pas la configuration de l'ensemble des dépendances existantes. Première étape :

Lire la documentation sur le site de Vue2-Leaflet

Maintenant que nous avons vu comment s'intègre le Leaflet, refléchissons comment intégrer ça dans notre projet :

À l'arrache dans le fichier main.js ? ✋ => NON
Dans un dossier plugins => 👍 Oui

À votre avis pourquoi ?
Création de la partie plugin
Créer le fichier src/plugins/vue2-leaflet.js y mettre dedans :
import { L } from "vue2-leaflet";
import "leaflet/dist/leaflet.css";

// this part resolve an issue where the markers would not appear
delete L.Icon.Default.prototype._getIconUrl;

L.Icon.Default.mergeOptions({
  iconRetinaUrl: require("leaflet/dist/images/marker-icon-2x.png"),
  iconUrl: require("leaflet/dist/images/marker-icon.png"),
  shadowUrl: require("leaflet/dist/images/marker-shadow.png")
});


D'où vient le code ?

Déclarer le plugin
Maintenant que la configuration du « plugin » est effective nous devons le déclarer dans notre fichier main.js pour ça rien de compliquer.
Ajouter l'import :
import "./plugins/vue2-leaflet";

🤓 Avec les autres imports déjà existant.
Questions

Pourquoi l'import est-il nécéssaire ?
Pourquoi vue2-leaflet et pas juste leaflet ?
Quel est l'avantage ?

Dépendance supplémentaire
Le gros avantage de NPM (et NodeJS) c'est la quantité de librairies disponibles pour répondre à un besoin, nous allons donc en profiter pour gagner du temps dans notre réalisation.
Firebase est plutôt simple à utiliser, mais nativement celle-ci ne s'intègre pas directement avec le « state » d'un composant VueJS! Mais grâce à d'excellents développeurs c'est maintenant possible et très simplement. Pour ça nous allons utiliser :

Vuefire

npm install vuefire --save

⚠️ Dans une prochaine étape nous allons configurer vuefire. Pour l'instant le package est disponible mais non actif.
🤓 Je vous invite quand même à aller voir la documentation de VueFire pour voir de quoi il en retourne !
Création du projet sur Firebase
Maintenant que nos dépendances sont installées et que notre projet est initialisé, nous allons configurer le projet sur Firebase :
Première étape créer le projet sur le site de Firebase

Maintenant que le projet est créé, nous allons récupérer la configuration :

Nous allons récupérer une partie du code fourni… Nous allons prendre la configuration (dans mon cas) :
// Initialize Firebase
var config = {
  apiKey: "✋-CHANGE-CHANGE-CHANGE-CHANGE-✋",
  authDomain: "reatlime-maps.firebaseapp.com",
  databaseURL: "https://reatlime-maps.firebaseio.com",
  projectId: "reatlime-maps",
  storageBucket: "reatlime-maps.appspot.com",
  messagingSenderId: "✋✋✋✋✋✋✋✋"
};

export default config;

Nous allons mettre le code dans le fichier src/config/firebase.js ⬅️
⚠️ ✋ Attention à bien changer la valeur de apiKey et messagingSenderId. ✋ ⚠️
BRAVO ! Votre projet est maintenant capable de « se connecter » avec Firebase !
Questions

Et la sécurité ? À votre avis comment ça fonctionne ?
Est-il possible de faire autrement ?

Activer la Realtime DB
Dans l'interface de Firebase activer la Realtime DB.
Modification du code pour inclure la configuration Firebase
Maintenant que nous avons ajouté la configuration, nous devons la déclarer dans notre code. Comme pour Vue2-Leaflet nous allons ajouter un fichier de « configuration du plugin » dans le dossier src/plugins/ ajouter un fichier nommé firebase.js avec le contenu suivant :
import firebaseConfig from "../config/firebase";
import firebase from "firebase/app";
import "firebase/database";
import Vue from "vue";

const firebaseApp = firebase.initializeApp(firebaseConfig);
const db = firebaseApp.database();

Vue.prototype.$db = db;

Comme pour leaflet, ajouter un import dans le fichier main.js pour référencer notre « configuration de plugin » :
import "./plugins/firebase";

Questions

Que fait le code ?
Comment connaitre les autres options ?
Vue.prototype ? Kézako ? On en parle !

Testons
Bien maintenant, que nous avons mis en place les bases de notre projet, testons si celui-ci fonctionne correctement. Pour ça (dans un terminal) :
npm run serve

Après quelques secondes de compilation (pré-processing) vous devriez avoir sur votre écran :

Et dans votre navigateur toujours la même chose à savoir :

Création de notre première vue / composant.
Notre projet est maintenant prêt à recevoir son premier .vue bien à vous. Toujours dans le but d'organiser son travail nous allons commencer par créer un dossier :

src/views/

Ce dossier nous servira à ranger l'ensemble de nos vues, pour l'instant nous allons créer une vue nommée map.vue ce fichier contiendra le code source de notre carte.
Créer le fichier src/views/map.vue avec le contenu suivant :







import { LMap, LTileLayer, LMarker, LControl } from "vue2-leaflet";

export default {
  name: "myMap",
  data() {
    return {
      url: "http://{s}.tile.osm.org/{z}/{x}/{y}.png",
      zoom: 13,
      center: [47.472092, -0.550589]
    };
  },
  components: {
    LMap,
    LTileLayer,
    LMarker,
    LControl
  },
  methods: {}
};



#map {
  height: 100%;
  width: 100%;
}


✋ D'où vient le code ? Tout simplement une adaptation du code de démonstration fourni par Vue2-Leaflet
Utiliser notre première vue
Créer la vue ne déclenche rien, il faut maintenant l'importer. Comme vu en cours, la « base » de notre application est répartie entre deux fichiers :

le main.js : qui contient les imports de base et la déclaration de notre objet .vue.
l'App.vue : qui contient la « racine » de notre HTML (c'est dans celui-ci que nous allons référencer notre nouvelle vue / composant).

Modifier le App.vue par :





import myMap from "./view/map.vue";

export default {
  name: "app",
  components: {
    myMap
  }
};



html,
body {
  margin: 0;
  padding: 0;
  height: 100%;
  width: 100%;
}


Questions

Quelles sont les différences ?
Pourquoi le CSS n'est pas scoped ?
À quoi correspond components ?

Tester
Votre projet doit maintenant afficher une carte, tester rapidement via la commande :
npm run serve


Configurer VueFire
Comme pour Vue2-Leaflet et firebase, vuefire nécéssite une déclaration pour être utilisé dans le projet.

Lire la documentation.
Créer le fichier dans le dossier plugins.
Réaliser l'import dans le fichier main.js.

🤓 C'est la 3ème fois de ce TP que vous le faites, vous devez être capable de le faire de vous même.
 Voir la solution src/plugins/vuefire.js
import Vue from "vue";
import VueFire from "vuefire";

Vue.use(VueFire);

main.js
// […]
import "./plugins/vuefire";

// […]



Connecter firebase à notre vue
Grace au plugin l'intégration de Firebase va être très simplifié. Déjà vous avez mis en place Firebase et injecter le connecteur de base de données grace au « plugin » et « Vue.prototype », nous allons devoir l'utiliser. Pour ça modifier le fichier maps.vue pour ajouter (après name) :
firebase: function() {
    return {
      markerList: this.$db.ref("/markerList/")
    };
  },

Questions :

D'où vient this.$db ?
À quoi correspond le /markerList/ ?

Et c'est tout ! Vous avez maintenant dans votre objet vue une nouvelle variable de disponible markerList celle-ci est synchronisée avec votre base de données temps réel (Firebase RealtimeDB).
Ajouter un marker
Pour ajouter un marker sur la carte nous allons utiliser la directive @stop sur l'objet l-map :

Ajouter sur l'objet  la directive suivante @click="addMarker".
Ajouter la méthode addMarker dans votre objet VueJS addMarker(marker){…} .
À votre avis à quoi doit ressembler le code ?
Ajouter un console.log(marker) avez-vous une propriété latlng ?



 Voir la solution addMarker(position) {
  this.$firebaseRefs.markerList.push([
    position.latlng.lat,
    position.latlng.lng
  ]);
},



Tester

Ouvrer la console de Firebase rendez-vous dans la partie Database.
Lancer votre projet local npm run serve.
Cliquer sur la carte.
Que constatez-vous ?

Afficher les markers
Les markers ne s'affichent pas ? C'est normal! Pour l'instant nous n'avons pas mis le code permettant de les afficher. C'est l'étape à laquelle nous sommes.
La logique va être simpliste, nous devons afficher TOUS les éléments contenus dans la variable markerList déclarée précédemment.
Les étapes :

Utilisation de l-marker
Le mettre en place dans le l-map en suivant la documentation.
Mise en place d'une boucle v-for.
et… c'est tout
Essayer sans regarder la solution.

 Voir la solution Le marker est à mettre dans le l-map.





Tester
npm run serve normalement des markers doivent s'afficher. Tenter d'en ajouter d'autre.
Suppression d'un marker
Bon maintenant qu'il y a plein de marker partout nous allons mettre en place le code pour les supprimer ! Voilà la procédure à suivre :

Ajout d'une méthode removeMarker

removeMarker(markerKey) {
  this.$firebaseRefs.markerList.child(markerKey).remove();
},


Ajouter la directive sur l-marker :

@click="() => removeMarker(marker['.key'])"

Tester
npm run serve tenter de supprimer un marker en cliquant dessus.
Tester à plusieurs
Accéder à plusieurs au même projet (via votre IP) pour tester la synchronisation.
Amélioration 1 : centrer la carte sur votre position
Profitons des nouvelles fonctionnalités de nos navigateurs pour améliorer notre carte. Actuellement la carte est centrée sur Angers… C'est pratique… Si on se trouve à Angers… dans tous les autres cas c'est pas forcément adapté. Nous allons donc utiliser l'API geolocation de notre navigateur.
Celle-ci permet de localiser une personne en fonction de sa connexion internet (ou GPS / Réseau téléphonique si disponible)

Documentation de l'API geolocation.
Ajouter une méthode dans le code dans le composant map.vue.
La méthode doit mettre à jour le this.center = [lat, lng].
La méthode doit être appelé via un clique utilisateur Documentation de LControl

 Voir la solution template :
Dans le l-map
 Localisez-moi 

methods :
getUserLocation() {
      if ("geolocation" in navigator) {
        navigator.geolocation.getCurrentPosition(
          position => {
            this.center = [position.coords.latitude, position.coords.longitude];
          },
          error => {
            console.error(error);
          }
        );
      }
    }

tp/cordova/vuejs_cordova.html.body:
Last modified: Sat Apr 06 2019 17:48:57 GMT+0200 (GMT+02:00)

VueJS et Cordova
Maintenant que nous avons vu les bases de Cordova (Création, Plateforme, plugin). Intéréssons nous à la création d’une vrai application. Dans le monde de cordova il existe plusieurs façon de faire :

Sans Framework.
Avec un framework web classique (type VueJS, ReactJS…)
Avec un framework dédié type ionic
Avec des solutions comme Phonegap

Pour ce TP nous allons faire une application en utilisant Cordova + VueJS.
Le projet
Nous allons réaliser une application qui teste plusieurs plugins Cordova. Cette application utilisera VueJS et VuetifyJS

Cette application sera très simple. Mais va permettre de tester la puissance de Cordova, nous allons utiliser les plugins suivants :

cordova-plugin-dialogs
cordova-plugin-vibration
cordova-plugin-geolocation
cordova-plugin-flashlight
cordova-plugin-camera
phonegap-nfc
cordova-plugin-statusbar
cordova-plugin-headercolor

Le code
Le projet étant assez conséquent je vous propose de partir d’une base déjà faite de l’application. Celle-ci contient :

L’accueil
Les scripts pour compiler la partie Cordova
Les plugins « pré-configurés » / déclaré dans le fichier config.xml.

Le code est téléchargeable ici
Utiliser le code fourni
Maintenant que vous avez récupéré le code. Nous allons le rendre fonctionnel pour votre ordinateur.
1. Compiler une première fois le code
Le projet étant « non compilé » / « non installé », nous allons devoir dans un premier temps installer les dépendances nécéssaires à notre projet. Pour se faire nous allons utiliser npm avec la commande install. Dans le dossier du projet :
npm install .

Les dépendances « VueJS » s’installent, l’installation peut prendre quelques minutes. Une fois installé tester le fonctionnement avec la commande :
npm run serve

Ouvrez un navigateur et accédez à l’url suivante http://localhost:8080/ vous devez voir :


Passer en mode « simulation de mobile » pour être proche de la compilation final.

2. Ajouter la plateforme
Ajouter la plateforme Android au projet :
cd cordova_app/
mkdir www
cordova platform add android

✋ Attention à bien créer le dossier www pour que l'outil Cordova détècte bien le projet comme étant un projet Cordova.
3. Lancer sur votre mobile
Maintenant que la plateforme est prête et que notre code est disponible, nous allons compiler l’application pour la lancer sur votre téléphone. La première étape est de « builder » l’application VueJS en version distribuable :
npm run build

✋ La configuration de base d’un projet VueJS créé par VueCLI n’est pas forcément le plus adapté pour Cordova. J’ai donc édité les fichiers :

build/build.js
config/index.js

Vous pouvez jeter un coup d’oeil pour voir les différences avec la version normal. Notamment la partie concernant le file://, cordova utilise l’URI file:// pour servir les ressources dans l’APK, par défaut les développeurs de VueCLI ont mis des liens avec / en dur ce qui pose des soucis. J’ai donc remplacé le / par ./ ce qui corrige le soucis.
Maintenant que le « build » est terminé nous pouvons réaliser le lancement sur le mobile via les commandes suivantes :
cd cordova_app/
cordova run android

✋ Votre mobile doit être connecté à cette étape, l’application va se lancer directement sur votre mobile. Si ce n’est pas le cas il vous faut un émulateur Android sur votre machine.
Ajouter la vue Localisation
Pour commencer nous allons ajouter la vue « Localisation ». C’est certainement la plus compliqué de toutes, mais c’est celle qui est la plus intéréssante en terme de fonctionnement.


Créer un fichier Localisation.vue dans le dossier views/
Ajouter le contenu suivant :

// Require Cordova Plugin : cordova-plugin-geolocation








        {{$t("getPosition")}}






  import 'leaflet/dist/leaflet.css';
  import L from 'leaflet';
  import {nativeAlert} from "../libs/";
  // Fix for icon problem with webpack
  // See https://github.com/PaulLeCam/react-leaflet/issues/255#issuecomment-261904061
  delete L.Icon.Default.prototype._getIconUrl;
  L.Icon.Default.mergeOptions({
    iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
    iconUrl: require('leaflet/dist/images/marker-icon.png'),
    shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
  });
  export default {
    name: 'localisation',
    data() {
      return {
        isLoading: true
      }
    },
    mounted() {
      // Init the leaflet map
      this.map = L.map('map').setView([47.47121, -0.55198], 5);
      L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png').addTo(this.map);
      this.getUserLocation();
    },
    beforeDestroy(){
      // Destroy the map object on leave
      if(!(this.map === undefined)){
        this.map.remove();
      }
    },
    methods: {
      stopLoading(){
        this.isLoading = false;
      },
      getUserLocation() {
        // Retrieve the current user location
        if (navigator.geolocation) {
          // If the geolocation is available
          navigator.geolocation.getCurrentPosition((position) => {
            // Get the current user position, and create a marker on the map.
            // Pssst, look at the position object there is a lot of more information
            let user_position = [position.coords.latitude, position.coords.longitude];
            L.marker(user_position).addTo(this.map);
            // Set the view on the user position at a correct zoom level
            this.map.setView(user_position, 18);
            this.stopLoading();
          }, () => {
            // If the geolocation plugin not answer or if we reach the timeout
            this.stopLoading();
            nativeAlert(this.$t("positionNotAvailable", this.$t("localisation")));
          });
        }else{
          // If the browser is not compatible
          nativeAlert(this.$t("positionNotAvailable", this.$t("localisation")));
          this.stopLoading();
        }
      }
    }
  }



